function convertProjectString($projectString) {
    // Menggunakan preg_match untuk menangkap proyek dengan lebih dari satu kata
    preg_match('/^(.*?)(\s+)([A-Z0-9\-]+)(\s+)([A-Za-z0-9]+)/', trim($projectString), $matches);

    // Memastikan bahwa kita mendapatkan bagian yang diperlukan
    if (count($matches) < 6) {
        return null; // Format tidak valid
    }

    // Mengambil bagian yang relevan
    $projectName = trim($matches[1]); // Nama proyek
    $key = trim($matches[3]);          // Kunci
    $token = trim($matches[5]);        // Token

    // Membuat array asosiatif
    return [
        $projectName => [
            "key" => $key,
            "token" => $token,
        ]
    ];
}

